import Counter from './Counter';
const recommender = {
    optionName: "Recommender",
    description: "Will recommend you a transfer",
    backGroundImg: "Insert URL"
}

function Home() {
    return (
        <div id="home-main">
            <div className="home-options-row">
                <HomeOption optionName="Recommender"/>
                <HomeOption optionName="Statistics"/>
            </div>
            <div className="home-options-row">
                <HomeOption optionName="Captain Picks"/>
                <HomeOption optionName="Players"/>
            </div>
        </div>
    )
};

function HomeOption(props) {
    return (
        <div className="home-option-container">
            <h2>{props.optionName}</h2>
        </div>
    )
}

export default Home;
